'''

-Hard-

*Hash Table*

You are given a string s and a positive integer k.

Let vowels and consonants be the number of vowels and consonants in a string.

A string is beautiful if:

vowels == consonants.
(vowels * consonants) % k == 0, in other terms the multiplication of vowels and consonants is divisible by k.
Return the number of non-empty beautiful substrings in the given string s.

A substring is a contiguous sequence of characters in a string.

Vowel letters in English are 'a', 'e', 'i', 'o', and 'u'.

Consonant letters in English are every letter except vowels.

 

Example 1:

Input: s = "baeyh", k = 2
Output: 2
Explanation: There are 2 beautiful substrings in the given string.
- Substring "baeyh", vowels = 2 (["a",e"]), consonants = 2 (["y","h"]).
You can see that string "aeyh" is beautiful as vowels == consonants and vowels * consonants % k == 0.
- Substring "baeyh", vowels = 2 (["a",e"]), consonants = 2 (["b","y"]).
You can see that string "baey" is beautiful as vowels == consonants and vowels * consonants % k == 0.
It can be shown that there are only 2 beautiful substrings in the given string.
Example 2:

Input: s = "abba", k = 1
Output: 3
Explanation: There are 3 beautiful substrings in the given string.
- Substring "abba", vowels = 1 (["a"]), consonants = 1 (["b"]).
- Substring "abba", vowels = 1 (["a"]), consonants = 1 (["b"]).
- Substring "abba", vowels = 2 (["a","a"]), consonants = 2 (["b","b"]).
It can be shown that there are only 3 beautiful substrings in the given string.
Example 3:

Input: s = "bcdf", k = 1
Output: 0
Explanation: There are no beautiful substrings in the given string.
 

Constraints:

1 <= s.length <= 5 * 104
1 <= k <= 1000
s consists of only English lowercase letters.


'''
from collections import Counter

class Solution:
    def beautifulSubstrings(self, s: str, k: int) -> int:
        n = len(s)
        cnt = Counter()
        cnt[(0,0)] = 1
        # for i in range(k//2):
        #     cnt[(0,i)] = 1
        # cnt1 = [0]*k
        # cnt1[0] = 1
        Vs = {'a', 'e', 'i', 'o', 'u'} 
        v, c = 0, 0
        ans = 0
        for i in range(n):
            if s[i] in Vs:
                v += 1            
            else:
                c += 1
            if c > 0 and v > 0:
               ans += cnt[(c-v, v%(k//2 if k > 2 and k % 2 == 0 else k))]
            cnt[(c-v, v%(k//2 if k > 2 and k % 2 == 0 else k))] += 1
            # cnt1[v%k] += 1
            print(i, s[i], c, v, ans, cnt)
        return ans
    
    
    def beautifulSubstrings2(self, s: str, k: int) -> int:
        # TLE
        n = len(s)
        cands = []
        for i in range(1, n+1):
           if (i**2) % k == 0:
              cands.append(i)                
        Vs = {'a', 'e', 'i', 'o', 'u'} 
        # print("cands: ",len(cands), len(s))
        cnt = Counter()
        cnt[(0,0)] = 1
        v, c = 0, 0
        res = 0
        for i in range(n):
            if s[i] in Vs:
                v += 1            
            else:
                c += 1
            if c > 0 and v > 0:
                for x in cands:
                    res += cnt[(c-v, v-x)]
            cnt[(c-v, v)] += 1
            # print(i, s[i], c, v, ans, cnt)
           
        return res
    
    def beautifulSubstrings4(self, s: str, k: int) -> int:
        n = len(s)
        l = 1
        while l*l % (k*4):
            l += 1
        x = l // 2
        Vs = {'a', 'e', 'i', 'o', 'u'} 
        cnt = Counter()
        cnt[(0,0)] = 1
        v, c = 0, 0
        res = 0
        for i in range(n):
            if s[i] in Vs:
                v += 1            
            else:
                c += 1
            # if c > 0 and v > 0:
            res += cnt[(c-v, v%x)]
            cnt[(c-v, v%x)] += 1
        return res
    

    def beautifulSubstrings3(self, s: str, k: int) -> int:
        # Lee215's Solution
        n = len(s)
        # l = next(i for i in count(1) if i * i % k == 0) * 2
        l = 1
        while l*l % (k*4):
            l += 1
        print('l = ', l)
        # for i in range(n+1):
        #     if i * i % k == 0:
        #        l = i**2
        vowels = set(list('aeiou'))
        seen = [Counter() for i in range(l)]
        seen[-1][0] = 1
        res = 0
        v = 0
        for i,c in enumerate(s):
            v += 1 if s[i] in vowels else -1
            res += seen[i % l][v]
            seen[i % l][v] += 1
        return res
            



